import './main.css';


import React from "react";

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


import Transactions from './Transactions'

function Main() {
  return (
    <Router>
      <div className="container">
            <header className='container top2'>
              <div className='row top2 centre'>
                  <h1>Estia</h1>
              </div>
            </header>
        <main className='container vertical-centre'>



            <Switch>

                <Route exact path="/">
                  <Transactions />
               </Route>
                <Route path="/transactions">
                  <Transactions />
               </Route>

              </Switch>                  
        </main>      
      </div>
    </Router>
  );
}

export default Main;
